                var condition = commandSplitted[1];

                var actionSplitted = action.Split(' ');
                var register = actionSplitted[0];
                var instruction = actionSplitted[1];
                var constant = actionSplitted[2];

                var conditionSplitted = condition.Split(' ');
                var condRegister = conditionSplitted[0];
                var condOperator = conditionSplitted[1];
                var condConstant = conditionSplitted[2];

                if (!registers.ContainsKey(condRegister)) {
                    registers.Add(condRegister, 0);
                }

                if (!registers.ContainsKey(register)) {
                    registers.Add(register, 0);
                }

                if (!checkCondition(registers[condRegister], condOperator, condConstant)) {
                    continue;
                }

                registers[register] = executeAction(registers[register], instruction, constant);
                maxValue = Math.Max(maxValue, registers[register]);
            }

            Console.WriteLine(String.Format("Puzzle Two Answer: {0}", maxValue));
