        private static int executeAction(int registerValue, string instruction, string constant) {
            var constantValue = Convert.ToInt32(constant);

            switch (instruction) {
                case "inc":
                    return registerValue += constantValue;

                case "dec":
                    return registerValue -= constantValue;

                default:
                    throw new Exception(String.Format("Bad instruction {0}", instruction));
            }
        }

        private static bool checkCondition(int registerValue, string condOperator, string condConstant) {
            var constantValue = Convert.ToInt32(condConstant);

            switch (condOperator) {
                case ">":
                    return registerValue > constantValue;

                case "<":
                    return registerValue < constantValue;

                case ">=":
                    return registerValue >= constantValue;

                case "<=":
                    return registerValue <= constantValue;

                case "==":
                    return registerValue == constantValue;

                case "!=":
                    return registerValue != constantValue;

                default:
                    throw new Exception(String.Format("Bad condition operator {0}", condOperator));
            }
        }
